CREATE TABLE public.users (
    "uuid"  varchar NOT NULL,
    "username" varchar(40) NOT NULL,
    "password" varchar(40) NOT NULL,
    "email" varchar(40) NOT NULL,
    PRIMARY KEY ("uuid")
);

CREATE TABLE public.food (
    "_id" varchar NOT NULL,
    "name" varchar(40) NOT NULL,
    "cost" varchar(10) NOT NULL,
    "restaurant_name" varchar(40) NOT NULL,
    "restaurant_address" varchar NOT NULL,
    "restaurant_city" varchar(40) NOT NULL,
    "restaurant_state" varchar(40) NOT NULL,
    "restaurant_zip" integer NOT NULL,
    "featured_on" varchar(40) NOT NULL,
    "streaming_on" varchar(40) NOT NULL,
    "food_img_url" varchar NOT NULL,
    PRIMARY KEY ("_id")
);

CREATE TABLE public.users_favorite_food (
    "_id" varchar NOT NULL,
    "user_id" bigint NOT NULL,
    "food_id" bigint NOT NULL,
    PRIMARY KEY ("_id")
);


